    <text
      transform="translate(289.18 559.92)"
      style={{
        isolation: "isolate"
      }}
      fontSize={56.142}
      fill="#010101"
      fontFamily="HiraginoSansGB-W3-GBpc-EUC-H,Hiragino Sans GB"
      letterSpacing="-.023em"
    />
    <text
      transform="translate(595.47 555)"
      style={{
        isolation: "isolate"
