    <path
      d="M222.22 84.24v61.09a8.78 8.78 0 0 1-8.94 8.94h-51.86a8.79 8.79 0 0 0-8.94 8.94v50.07a8.78 8.78 0 0 1-8.94 8.94h-124a8.78 8.78 0 0 1-8.94-8.94v-50.39a9 9 0 0 1 8.94-8.94l49.77-.89a9.16 9.16 0 0 0 8.94-8.94v-51a8.78 8.78 0 0 1 8.94-8.94h53.67a8.78 8.78 0 0 0 8.94-8.94V19.57a8.78 8.78 0 0 1 8.94-8.94h61.09M219.83 10.63h9.18M219.83 10.63h13.74"
      fill="none"
      stroke="#d22026"
      strokeWidth={21.254}
    />
  </svg>
);

export default SvgLogo;
